INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'article', 0, 1, 1, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chào các bạn,</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Các bạn đang đọc&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Xanh</em>&nbsp;và hôm nay là thứ Ba. Thứ ba của tuần thứ tư Xanh đến với các bạn.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Thiệt ra Xanh không định kể chuyện hôm nay, vì đang để nhiều bài về Doraemon cho nó đẹp. Nhưng mà thôi không sao, tại viết xong để ảnh minh họa là Doraemon thì cũng đẹp mà.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chắc các bạn cũng thấy Xanh hôm nay tràn ngập ảnh Doraemon đúng không? Nhìn vui mắt, các bạn ha.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Xanh và đồng bọn có lẽ là khá may mắn khi hồi nhỏ xíu xíu đã được làm quen với Doraemon từ những ngày đầu tiên Doraemon đến Việt Nam với tên gọi Đôrêmon chú mèo máy thông minh.&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">(Thiệt ra đọc thì chúng ta đều thấy bạn đó cũng không thông minh lắm, chỉ thấy cu te đáng iu vô cùng thôi he he)</em>.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Làm quen với bạn đó từ nhỏ rồi lớn lên vẫn nhớ vẫn quý bạn đó lắm. Bắt gặp đâu đó cuốn sách về Doraemon là cắm đầu vào đọc, thấy có phim nào là chúi mũi vào xem, và like túi bụi bất kỳ cái hình Doraemon nào thấy trên Facebook. Chắc chắn có nhiều bạn thấy chuyện ngồi túm tụm năm ba đứa mặt mũi già chát vừa cà phê vừa nói về Doraemon là chuyện hết sức bình thường. Cũ kỹ mốc meo là bọn kể ê mày nhớ hồi xưa tập Doraemon đầu tiên tên gì không, nhớ tập&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Lạc vào xứ sở thần tiên</em>&nbsp;không, nhớ&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Bánh mì chuyển ngữ</em>&nbsp;không, nhớ&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Cá mập lên bờ</em>&nbsp;không vân vân. Hay là sáu tập đầu tiên của truyện dài Doraemon chắc chắn khó có bạn nào quên được từ cuốn đầu tiên là<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Lâu đài dưới đáy biển</em>&nbsp;hay cuộc phiêu lưu sang châu Phi, rồi vào lòng đất với đám khủng long. Ngồi cùng nhau, có đứa trẻ nào chưa từng ước ao có&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">bánh mì chuyển ngữ</em>&nbsp;để khỏi học môn Anh văn cho cực, có&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">máy ảnh tạo mốt</em>, có<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">cánh cửa thần kỳ</em>, có&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">cỗ máy thời gian</em>&nbsp;hay tham lam một cách dễ thương hơn là có cả cái&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">túi thần kỳ</em>.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Mà không phải chỉ những đứa trẻ, giờ tụi mình lớn lên tụi mình vẫn muốn có một món bảo bối nào đó của Doraemon giúp mình trong từng chặng đường mình đang đi. Hy vọng và ước mơ là những gì đứa trẻ con nào cũng có thể tập tành nuôi dưỡng từ những trang truyện thời thơ bé. Dĩ nhiên, phép màu thật sự không dễ đến với chúng ta nhưng những câu chuyện về bạn bè, những cuộc hành trình đầy mê đắm mà chú mèo máy cùng đồng bọn, những Nobita, Xuka, Chaien, Xeko đem đến cho tâm hồn mỗi đứa lại là thứ bùa phép màu nhiệm tinh khôi và trong sáng nhất của một thời nào đó.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Những thứ giản đơn thơ trẻ đó chúng ta dễ dầu gì có lại được khi lớn lên.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Vì vậy, thi thoảng nhớ về một quãng thời gian để thấy mình vẫn ngây ngô, vẫn đầy tin tưởng, vẫn ngập tràn mơ ước. Và quan trọng nhất là vẫn thấy mình trẻ trung vời vợi và luôn có đâu đó một người bạn tên là Doraemon cùng đồng hành trên mọi nẻo đường mình đi qua.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">&nbsp;<img src="/site/sites/default/files/184924_10151221578299347_738658414_n.jpg" alt="" width="720" height="393" /></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chúc các bạn của Xanh sẽ luôn như vậy.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Cười nhiều, hạnh phúc và nuôi dưỡng ước mơ tươi đẹp mãi nha.</p>', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chào các bạn, các bạn đang đọc Xanh. Hôm nay là thứ Hai, trời đẹp.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Để bắt đầu ngày đầu tiên của một tuần mới, Xanh sẽ kể các bạn nghe một câu chuyện cũ.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Có hai anh em cậu bé kia quyết định đào một cái hố sâu phía sau nhà. Khi hai cậu bé đang đào, vài đứa trẻ khác đến xem và hỏi họ đang làm gì. Cậu anh mới hào hứng trả lời rằng anh em cậu muốn đào một đường hầm xuyên qua trái đất.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Mấy đứa trẻ cười phá lên, chế giễu anh em cậu. Thế nhưng hai cậu bé vẫn tiếp tục đào. Một lúc sau, một cậu nhảy từ cái hố đang đào lên mặt đất, tay cầm một cái chai cũ kỹ đầy nhện, sâu bọ, côn trùng đáng sợ và tay kia giơ cao một túi chứa các viên đá xinh xắn đang lấp lánh phản chiếu ánh mặt trời. Cậu chỉ cho những đứa trẻ kia xem những viên đá tuyệt đẹp ấy và tự hào nói:&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">“Ngay cả khi không đào được đường hầm xuyên trái đất, thì ít nhất bọn mình cũng có thể tìm được những viên đá đẹp như thế, và mình cũng đã có dịp khuất phục lũ côn trùng gớm ghiếc này!”</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Câu chuyện nhỏ của bọn trẻ con này nhắn nhủ với chúng ta mấy điều cũng nhỏ thôi, nếu nhìn dưới góc nhìn của người lớn.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Không phải mục tiêu nào cũng hoàn thành trọn vẹn.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Không phải công việc nào cũng đều kết thúc thành công.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Không phải nỗ lực nào cũng được đền đáp xứng đáng.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Không phải mối quan hệ nào cũng giữ được bền lâu.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Không phải tình yêu nào rồi cũng là vĩnh cửu.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Không phải ước mơ nào cũng trở thành hiện thực.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Nhưng nếu bạn luôn lo sợ và không dám bắt đầu, bạn sẽ không bao giờ có cơ hội đặt chân lên con đường đến thành công. Ngay cả chuyện thấy được gì trên con đường đó, dù xấu dù tốt, cũng không có cơ hội luôn.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Thứ Hai, Xanh chúc các bạn vui và đủ dũng cảm để đi thử trên những con đường mà hôm qua ta còn dè dặt. Cứ thử, biết đâu được.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Nhớ quay lại Xanh nha. Chiều nay, trên Xanh sẽ có nhiều trò vui lắm.&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Xanh đảm bảo</em>.</p>', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Chào các bạn, các bạn đang đọc Xanh.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Hôm nay là Chủ Nhật. Hôm nay là ngày đầu tiên của một tháng, và tháng đó là tháng cuối cùng của năm nay. Hôm nay cũng là ngày toàn thế giới phòng chống AIDS.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Và hôm nay là ngày cuối cùng của tuần thứ ba Xanh đến với các bạn.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Từ hôm nay Xanh bắt đầu hai cái đếm ngược.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Một là đếm ngược đến hết tháng này, vì những ngày cuối năm là những ngày chúng ta có nhiều việc phải làm. Đây cũng là quãng thời gian để mỗi người chúng ta nhìn lại mình trong suốt một năm qua.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Hai là Xanh sẽ đếm ngược từ 11, 10, 9, 8… cho đến 1. Ngày 11/12/2013 này là ngày tròn một tháng Xanh ra mắt các bạn. Các bạn có nhớ không?</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Không biết các bạn đã quen với sự có mặt của Xanh chưa? Trong tháng mười hai này Xanh bắt đầu hoàn thiện dần các chuyên mục của mình, về nội dung cũng như về hình thức. Xanh cũng sẽ cố gắng hơn trong việc làm mới mình từng ngày để mỗi ngày càng bạn đọc Xanh đều cảm thấy vui.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Xanh hy vọng rằng kỷ niệm đúng một tháng, Xanh và những người bạn thực hiện Xanh sẽ có thêm nhiều điều mới lạ dành cho các bạn. Các bạn cùng chờ chung với Xanh nha.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;">Hôm nay là Chủ Nhật, như thường lệ, Xanh chúc các bạn có một ngày trọn vẹn với đầy đủ niềm vui và những điều tốt đẹp.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-size: 12px; line-height: 18px; color: #555555;"><img src="/site/sites/default/files/1471140_10201132670747258_749781444_n.jpg" alt="" width="720" height="479" /></p>', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chào các bạn,</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Thấy dòng phía trên dĩ nhiên là các bạn đang đọc Xanh. Hôm nay là thứ Bảy và hôm nay là một ngày<s style="outline: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">đẹp trời</s>&nbsp;lười biếng.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Vì lười biếng nên Xanh không nói gì thêm với các bạn đâu. Các bạn xem phim hoạt hình ngắn dưới đây nha. Phim của nhóm&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Colory Animation Studio</em>&nbsp;làm, lần đầu tiên trình chiếu trên Youtube là ngày 21/5/2011.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Bạn nào xem rồi thì xem lại nha. Còn bạn nào chưa coi thì coi nha vì phim dễ thương lắm.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Giờ thì Xanh nằm lăn ra đây. Thứ Bảy mà, lazy day mà. Chúc các dzui và khỏe, còn muốn nằm lăn quay thì cứ tự nhiên nha.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">&nbsp;</p><div class="video-container"><iframe src="//www.youtube.com/embed/7pbHLAIFi0A?feature=player_embedded" frameborder="0" width="720" height="420"></iframe></div><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><img src="/site/sites/default/files/duoibongcay2-1024x575.jpg" alt="" width="1024" height="575" /></p>', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chào các bạn,</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Đây là Xanh Thứ Sáu và chúng mình sẽ cùng nói chuyện viết thư. Đây không phải là chuyện viết cho người yêu, cho bạn, bạn cũ lâu ngày không gặp, mà là viết cho một người hoàn – toàn – xa – lạ. Một người bạn không biết gì về họ và họ cũng không biết gì về bạn.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Nghe có ngớ ngẩn và điên rồ không? Nhưng là một sự điên rồ thú vị.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Trước tiên, hãy nghe câu chuyện của Xanh. Đó là một ngày gần Tết và Xanh đang ở trong một cơn buồn bã thảm hại. Xanh loay hoay cả buổi trên một trang mạng thường ghé thăm để tìm cảm hứng. Thế rồi, đùng một cái, ý tưởng ùa đến trong đầu. Xanh hỏi có bạn nào muốn nhận được một bức thư ngày tết không. Thú thực là Xanh chỉ viết hú họa vậy thôi chứ không mong chờ gì hồi âm. Ai ngờ sau đó có một bạn đã để lại địa chỉ cho Xanh. Hứa là làm, Xanh cặm cụi viết một bức thư cho bạn ấy. Tất nhiên là mới chỉ qua email thôi (mở đầu cho những lần gửi thư tay sau đó).</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chuyện thư cho người lạ này vui hơn Xanh tưởng rất nhiều khi bạn nói bạn là một du học sinh, nơi đó đang rất lạnh và lòng bạn cũng thật buồn. Bức thư của Xanh vô tình đã mang lại chút ấm áp trong những ngày tết xa nhà của bạn. Xanh còn nhớ rất rõ, bạn đó nói,&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">cậu không biết đã giúp mình nhiều đến như thế nào đâu.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Xanh không biết thật. Nhưng Xanh biết một điều khác, rằng lòng Xanh khi đó cũng vui lên nhiều lắm.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Còn nhiều chuyện khác nhưng hãy để Xanh kể cho bạn nghe vào một lần sau.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Bạn có muốn thử viết thư cho một người lạ không?</p>', '', 'filtered_html'),
('node', 'article', 0, 7, 7, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">“<strong style="outline: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; line-height: inherit;">Xóa hết dấu vết trước khi về nhà</strong>” không phải là một quyển sách tử tế</em>. Tử tế theo kiểu tiến sĩ hạnh phúc gia đình chuyên khuyên chị em phụ nữ phải vị tha, hi sinh, kiên nhẫn và n cái “phải” nữa. Hoặc tử tế kiểu tâm sự trên báo mạng xyz trong đó các ông chồng thay nhau ăn năn hối hận sau những cuộc lỡ bước lầm đường. Kiểu thanh niên nghiêm túc dù có vào nhà nghỉ cũng chỉ nắm tay và ngủ trong sáng lại càng không. Cũng may, Đức Long không viết một quyển tử tế kiểu thế! Vì nó sẽ được bọc kính và cất vào viện bảo tồn những giá trị tinh thần không đến từ Trái Đất,&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">chứ phụ nữ nào thèm mua và đọc</em>!</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555; text-align: center;"><a style="outline: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; color: #333333; -webkit-transition: all 0.3s ease 0s; transition: all 0.3s ease 0s;" href="http://xanhmagazine.com/wp-content/uploads/2013/12/Xoahetdauvet.jpg"><img class=" wp-image-3366 aligncenter" style="margin: auto; outline: 0px; font-family: inherit; font-size: inherit; font-style: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit; display: block; max-width: 100%; height: auto !important;" src="http://xanhmagazine.com/wp-content/uploads/2013/12/Xoahetdauvet.jpg" alt="Xoahetdauvet" width="320" /></a></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;"><em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">“Xóa hết dấu vết trước khi về nhà”</em>&nbsp;đểu đểu, bí ẩn và lạnh lùng cơ! Đúng kiểu hấp dẫn phụ nữ nhất, mặc dù bị hấp dẫn xong rồi thì cô nào cũng than thở rằng đời mình xui xẻo, mình bị lừa, yêu đương gì đâu đau khổ quá. Quyển này chính là như thế! Là phụ nữ, bạn sẽ dễ… ấm ức và bứt rứt (thậm chí bứt luôn vài trang sách) trước ngòi bút của Đức Long. Anh có cái biệt tài chọt (bằng ngòi bút) trúng tử huyệt của chị em, nói mổ xẻ phân tích chặt chém cũng chẳng quá! Chẳng hạn như thế này: “Tôi không cố tranh tụng cho đàn ông. Tôi chỉ muốn phụ nữ hiểu rõ rằng chẳng có ai đang gây tội cho ai trong mối quan hệ công bằng và sòng phẳng mang tên tình ái”; hoặc thế này: “Khi phụ nữ mất hứng, cả thế giới là đồ tồi.” Đúng quá đúng! Đúng đến mức đọc sách, bạn dễ có cảm giác mình đang khỏa thân về mặc tâm lý. Và thấy hóa ra phụ nữ không ghét bị lột trần như tưởng tượng, bằng chứng là các bạn vẫn sẽ đọc tiếp, đến trang cuối cùng. Và có thể sẽ đọc lại lần nữa.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Phụ nữ thông minh cần đọc&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">“Xóa hết dấu vết trước khi về nhà”</em>. Không phải để tăng kỹ năng bắt bài các đức ông chồng, bạn trai, người yêu, người tình của mình. Mà để nhận ra mối quan hệ giữa đàn ông và phụ nữ không rắc rối trừu tượng như chúng ta vẫn cố tình làm quá. Đôi khi chúng ta mải mê tìm mọi cách để nắm đầu chàng, mà không nhận ra có những thứ khác của chàng ta đã nắm từ lâu. Chẳng hạn như tim. Và ví tiền. Vậy thì còn việc gì phải xoắn!</p>', '', 'filtered_html'),
('node', 'article', 0, 8, 8, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Chào các bạn, các bạn đang đọc Chuyện hôm nay.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Và đây là&nbsp;<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">Xanh</em>-<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">đầy-mùi-sơn</em>.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Khi bạn đang đọc những dòng này thì quá trình sơn lại căn phòng của Xanh cũng gần hoàn tất.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Một buổi sáng đẹp trời, Xanh thức giấc và quyết định phải làm mới căn phòng của mình. Đó là nơi mà Xanh vào-ra, làm việc, đọc sách, viết thư, vẽ tranh, ngủ gục trên bàn mỗi ngày. Mỗi ngày. Vậy mà từ lâu trong lòng đã chán nó tới tận mang tai rồi. Tủ sách cồng kềnh và cũ kỹ. Tài liệu để lộn xộn trong phòng. Trần nhà dày lên những mạng nhện. Và trong ngăn bàn đầy những giấy nháp vo viên.</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Rốt cuộc, Xanh dành trọn hai ngày cuối tuần để bê hết đồ đạc ra ngoài, sơn lại toàn bộ căn phòng, mua kệ sách mới, và trồng một cái cây ở trên tường. Cái cây này không trồng bằng đất, mà được dựng lên bởi hộp sơn, cây cọ và bàn tay tỉ mẩn của Xanh (cứ coi như là) thừa mứa thời gian. Thân cây thật cao màu nâu trầm cùng những lá xanh ngan ngát mọc trên từng cành nhỏ. Vì sợ cây buồn, Xanh đã cố ý vẽ thêm hai chú chim non đang bay về bên cây hót mừng xuân đến<em style="outline: 0px; font-family: inherit; font-size: inherit; font-variant: inherit; font-weight: inherit; line-height: inherit;">.</em></p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">Thật khó để không mường tượng về những tháng ngày sau này, khi Xanh tha hồ lười biếng ngồi dưới vòm cây xanh, đọc những cuốn sách mình yêu thích, bò dài ra sàn nhà vẽ một bức tranh mới, cười nghiêng ngả khi xem một bộ phim, khóc sướt mướt đọc tiểu thuyết hay ngồi im lặng nghe nhạc…&nbsp;</p><p style="margin-top: 0px; margin-bottom: 10px; outline: 0px; font-family: Georgia, arial, sans-serif; font-size: 12px; line-height: 18px; color: #555555;">&nbsp;</p>', '', 'filtered_html');
