INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' chuyện hôm nay nuôi lớn những ước mơ chào các bạn các bạn đang đọc  xanh  và hôm nay là thứ ba thứ ba của tuần thứ tư xanh đến với các bạn thiệt ra xanh không định kể chuyện hôm nay vì đang để nhiều bài về doraemon cho nó đẹp nhưng mà thôi không sao tại viết xong để ảnh minh họa là doraemon thì cũng đẹp mà chắc các bạn cũng thấy xanh hôm nay tràn ngập ảnh doraemon đúng không nhìn vui mắt các bạn ha xanh và đồng bọn có lẽ là khá may mắn khi hồi nhỏ xíu xíu đã được làm quen với doraemon từ những ngày đầu tiên doraemon đến việt nam với tên gọi đôrêmon chú mèo máy thông minh   thiệt ra đọc thì chúng ta đều thấy bạn đó cũng không thông minh lắm chỉ thấy cu te đáng iu vô cùng thôi he he   làm quen với bạn đó từ nhỏ rồi lớn lên vẫn nhớ vẫn quý bạn đó lắm bắt gặp đâu đó cuốn sách về doraemon là cắm đầu vào đọc thấy có phim nào là chúi mũi vào xem và like túi bụi bất kỳ cái hình doraemon nào thấy trên facebook chắc chắn có nhiều bạn thấy chuyện ngồi túm tụm năm ba đứa mặt mũi già chát vừa cà phê vừa nói về doraemon là chuyện hết sức bình thường cũ kỹ mốc meo là bọn kể ê mày nhớ hồi xưa tập doraemon đầu tiên tên gì không nhớ tập  lạc vào xứ sở thần tiên  không nhớ  bánh mì chuyển ngữ  không nhớ  cá mập lên bờ  không vân vân hay là sáu tập đầu tiên của truyện dài doraemon chắc chắn khó có bạn nào quên được từ cuốn đầu tiên là lâu đài dưới đáy biển  hay cuộc phiêu lưu sang châu phi rồi vào lòng đất với đám khủng long ngồi cùng nhau có đứa trẻ nào chưa từng ước ao có  bánh mì chuyển ngữ  để khỏi học môn anh văn cho cực có  máy ảnh tạo mốt  có cánh cửa thần kỳ  có  cỗ máy thời gian  hay tham lam một cách dễ thương hơn là có cả cái  túi thần kỳ  mà không phải chỉ những đứa trẻ giờ tụi mình lớn lên tụi mình vẫn muốn có một món bảo bối nào đó của doraemon giúp mình trong từng chặng đường mình đang đi hy vọng và ước mơ là những gì đứa trẻ con nào cũng có thể tập tành nuôi dưỡng từ những trang truyện thời thơ bé dĩ nhiên phép màu thật sự không dễ đến với chúng ta nhưng n