(2, 'node', ' chuyện hôm nay đường hầm xuyên qua trái đất chào các bạn các bạn đang đọc xanh hôm nay là thứ hai trời đẹp để bắt đầu ngày đầu tiên của một tuần mới xanh sẽ kể các bạn nghe một câu chuyện cũ có hai anh em cậu bé kia quyết định đào một cái hố sâu phía sau nhà khi hai cậu bé đang đào vài đứa trẻ khác đến xem và hỏi họ đang làm gì cậu anh mới hào hứng trả lời rằng anh em cậu muốn đào một đường hầm xuyên qua trái đất mấy đứa trẻ cười phá lên chế giễu anh em cậu thế nhưng hai cậu bé vẫn tiếp tục đào một lúc sau một cậu nhảy từ cái hố đang đào lên mặt đất tay cầm một cái chai cũ kỹ đầy nhện sâu bọ côn trùng đáng sợ và tay kia giơ cao một túi chứa các viên đá xinh xắn đang lấp lánh phản chiếu ánh mặt trời cậu chỉ cho những đứa trẻ kia xem những viên đá tuyệt đẹp ấy và tự hào nói   ngay cả khi không đào được đường hầm xuyên trái đất thì ít nhất bọn mình cũng có thể tìm được những viên đá đẹp như thế và mình cũng đã có dịp khuất phục lũ côn trùng gớm ghiếc này  câu chuyện nhỏ của bọn trẻ con này nhắn nhủ với chúng ta mấy điều cũng nhỏ thôi nếu nhìn dưới góc nhìn của người lớn không phải mục tiêu nào cũng hoàn thành trọn vẹn không phải công việc nào cũng đều kết thúc thành công không phải nỗ lực nào cũng được đền đáp xứng đáng không phải mối quan hệ nào cũng giữ được bền lâu không phải tình yêu nào rồi cũng là vĩnh cửu không phải ước mơ nào cũng trở thành hiện thực nhưng nếu bạn luôn lo sợ và không dám bắt đầu bạn sẽ không bao giờ có cơ hội đặt chân lên con đường đến thành công ngay cả chuyện thấy được gì trên con đường đó dù xấu dù tốt cũng không có cơ hội luôn thứ hai xanh chúc các bạn vui và đủ dũng cảm để đi thử trên những con đường mà hôm qua ta còn dè dặt cứ thử biết đâu được nhớ quay lại xanh nha chiều nay trên xanh sẽ có nhiều trò vui lắm  xanh đảm bảo  chuyện hôm nay ', 0),
